import React, { Component } from 'react';
import DailyHabitTracker from './DailyHabitTracker.jsx';
import WeeklyReview from './WeeklyReview.jsx';

class WeeklyPlanner extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    componentDidMount() {
        this.fetchWeeks();
    }

    fetchWeeks() {
        fetch('/weeks')
            .then(res => res.json())
            .then(weeks => this.setState({weeks}))
    }

    render() {
        const { weeks } = this.state;

        return (
            <>
                <ul>
                    {weeks.map(week => <li>{week.weekNumber}</li>)}
                </ul>
                <DailyHabitTracker />
                <WeeklyReview />
            </>
        )
    }
}

export default WeeklyPlanner;
